der to process customer transactions; if the customer requests it; the disclosure is required or allowed by law (i.e. exchange of information with reputable reporting agencies, subpoena, or the investigation of fraudulent activity, etc.); or in conjunction with joint marketing agreements we have entered into. RAKBANK does not provide account or personal information to other companies for the purpose of independent telemarketing or direct mail marketing of any non-financial products or services of those companies.\n\n# Online protection\n\nRAKBANK has taken all appropriate measures to protect the personal information provided by you to RAKBANK and uses several security levels.\n\n# Terms & Conditions\n\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. \nIt has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. \n\nIt was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\n\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. \n','https://mk0bfsieletsonlt96u6.kinstacdn.com/wp-content/uploads/2017/11/Rak-Bank.jpg',1,'2020-11-06 11:32:18','2020-11-12 09:46:13',NULL),(5,'1.0.3','1','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. \nIt has survived not only five centuries, but also 